        <div>
            <h2>Search for your food</h2>
            <form>
                <label for="name_field">Food Name: </label>
                <input id="name_field" type="text" value={FoodName} onChange={ (e) => SetFoodName(e.target.value)} />
                <button type="button" onClick={searchButtonPressed}>Search</button>
            </form>
            <p>Food: {}</p>
        </div>
    )
}

